Terwijl Henry Oldfield op weg is naar de boerderij waar hij is opgegroeid, bezoeken ook twee activisten de boerderij, die nu in handen is van Henry's broer Angus. Deze hebben namelijk in de gaten dat Agnus experimenten uitvoert met schapen en willen dit stoppen. Maar dan gaat er iets goed mis en langzaam maar zeker beginnen alle schapen in de omgeving te transformeren in bloeddorstige, gewelddadige en levensgevaarlijke schapen:
